function (doc,req) {

    // Processes _rewrite request to domain root,
    // used when Photon runs through vhost.
    // Imitates CouchDB root when json is requested,
    // otherwise redirects to Photon.

		var info = req.info,
				uuid = req.uuid,
				rejson = /(application|text)\/json/;

		// We have request to DB root, fake CouchDB root response
		if (!req.headers.Accept || rejson.test(req.headers.Accept+'')) return {json:{
			couchdb: 		'Welcome',
			uuid: 			uuid,
			version: 		'3.0.0',
			features:		['access-ready'],
			vendor: {
				name: 		'The Apache Software Foundation'
			}
		}};

		// Page requested, redirecting to Photon
		return {
			code:			302,
			headers:	{Location:'/_photon/'},
			body:			''
		}
	}

validate_doc_update:
function (newDoc,oldDoc,userCtx,secObj) {

	var members = (secObj||{}).members || {names:[], roles:[]};

  // Pass through if bucket is already protected by Couch
  if (members.names.length || members.roles.length) {
    return;
  }

  // For public bucket only allow admins to write
	if (!_admin()) throw({forbidden: 'Insufficient privileges'});

  return;

  // - - - - - - - - - - - -

  function _admin() {
		// see if the user is a server admin
		if(userCtx.roles.indexOf('_admin') !== -1) {
			return true; // a server admin
		}

		// see if the user a database admin specified by name
		if(secObj && secObj.admins && secObj.admins.names) {
			if(secObj.admins.names.indexOf(userCtx.name) !== -1) {
				return true; // database admin
			}
		}

		// see if the user a database admin specified by role
		if(secObj && secObj.admins && secObj.admins.roles) {
			var db_roles = secObj.admins.roles;
			for(var idx = 0; idx < userCtx.roles.length; idx++) {
				var user_role = userCtx.roles[idx];
				if(db_roles.indexOf(user_role) !== -1) {
					return true; // role matches!
				}
			}
		}

		return false; // default to no admin
	}

}
